import React from "react";
import NavBar from "./NavBar.js";
import Table from "./usersbackenddummy.js"
import './advertisement.css';

function Advertisement() {
    return (
        <div className="front">
            <NavBar class="top" />
            <h1>광고내역</h1>
            <Table/>
        </div>
    );
}

export default Advertisement;
